import React from "react";

function Home() {
  return (
    <div>
      <h1>Willow</h1>

      <div className="homepagecontents">
        <card>
          <h2>Projects</h2>
          <div>Placeholder Text for Projects hello</div>
        </card>
        <card>
          <h2>Messages</h2>
          <div>Placeholder Text for Messages</div>
        </card>
        <card>
          <h2>Updates</h2>
          <div>Placeholder Text for Updates</div>
        </card>
      </div>
    </div>
  );
};

export default Home;
